import './App.css';

 const particlesOptions = {
                particles: {
                  line_linked: {
                    shadow: {
                      enable: true,
                      color: "#3CA9D1",
                      blur: 5
                    }
                  }
                }
              }
class App extends React.Component {
  render() {
    return (
      <div className="App">
      <Particles 
              params={particlesOptions}
            />
        <Navigation />
         <Logo />
         <Rank />
       <ImageLinkForm />
        { // <FaceRecognition /> 
      }
      </div>
    );
  }
}

export default App;
